// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import CompanyExplorer from './components/CompanyExplorer';
import ResumePage from './pages/ResumePage';
import ResumePreviewPage from './pages/ResumePreviewPage';
import RoadmapPage from './pages/RoadmapPage';
import InterviewPage from './pages/InterviewPage';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        {/* üîó Navbar */}
        <nav className="bg-white shadow p-4 flex space-x-6">
          <Link to="/" className="text-blue-600 font-semibold hover:underline">
            üè¢ Companies
          </Link>
          <Link to="/resume" className="text-blue-600 font-semibold hover:underline">
            üìù Resume Builder
          </Link>
          <Link to="/roadmap" className="text-blue-600 font-semibold hover:underline">
            üìö Roadmap Generator
          </Link>
          <Link to="/interview" className="text-blue-600 font-semibold hover:underline">
            üíº Mock Interview
          </Link>
        </nav>

        {/* üîÅ Routes */}
        <Routes>
          <Route path="/" element={<CompanyExplorer />} />
          <Route path="/resume" element={<ResumePage />} />
          <Route path="/resume/preview" element={<ResumePreviewPage />} />
          <Route path="/roadmap" element={<RoadmapPage />} />
          <Route path="/interview" element={<InterviewPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
